script: |
  super -f text -I q5308.spq | sort > q5308.out

inputs:
  - name: q5308.spq
    data: |
      SELECT + col0 AS col1 FROM tab1 (FORMAT parquet) WHERE NOT + ( - - 74 ) + + col1 <= NULL AND NOT NULL BETWEEN col0 / - 84 / col0 AND ( - 19 ) * + 33 + + col2;
  - name: tab1

outputs:
  - name: q5308.out
    data: |
